// SPDX-License-Identifier: MIT
pragma solidity ^0.8.2;

import "./IBEP20.sol";
import "./IMarketplace.sol";
import "./SafeMath.sol";
import "./Ownable.sol";
import "./AccessControl.sol";
import "./ERC721.sol";
import "./ERC721Pausable.sol";
import "./IPieceCore.sol";
import "./ReentrancyGuard.sol";

contract PiecePackage is Ownable, ERC721Pausable, ReentrancyGuard {
    using SafeMath for uint256;

    struct Package {
        uint256 packageId; // id of the package
        uint8 quantity; // quantity of robots on this package
        PackageType packageType; //package type
        uint64 birthTime; // The timestamp from the block when this Robot came into existence.
    }

    enum PackageType {
        Default,
        First,
        Second,
        Third
    }

    /*** STORAGE ***/
    /// @dev An array containing the Piece struct for all pieces in existence. The ID
    ///  of each Piece is actually an index into this array.
    Package[] packages;

    mapping(uint256 => bool) usedNonces;
    mapping(PackageType => uint8) private _packageTypePieces;
    mapping(PackageType => uint256) private _packageTypePrice;

    uint32 firstPackageCount;
    uint32 secondPackageCount;
    uint32 thirdPackageCount;
    uint32 fourthPackageCount;
    uint32 firstPackageLimit = 300;
    uint32 secondPackageLimit = 150;
    uint32 thirdPackageLimit = 75;

    uint256 private priceFirstPackage = 0.2 * 10**18; // to review
    uint256 private priceSecondPackage = 0.5 * 10**18; // to review
    uint256 private priceThirdPackage = 0.9 * 10**18; // to
    uint256 private nextPackageTokenId = 1;
    uint256 private piecePackagePrice = 5 * 10**18; // to review

    /* SETTABLE VARIABLES */
    bool public canUnpack;
    bool public isPackageAvailable;
    address public _mekaAddress;
    address public _pieceAddress;
    address public _adminAddress;
    bool public isBurn;

    event PackageCreated(
        address to,
        uint256 packId,
        uint8 packageType,
        uint256 date
    );
    event Unpacked(
        address from,
        uint256 packId,
        uint8 packageType,
        uint256 date
    );
    event MintedPieceFromBundle(address from, uint256[] pieceId, uint256 date);

    constructor(address mekaAddress, address pieceAddress)
        ERC721("Mekabot Piece", "MekaPiece")
    {
        isBurn = true;
        _mekaAddress = mekaAddress;
        _pieceAddress = pieceAddress;
        canUnpack = true;
        isPackageAvailable = true;

        setPackageTypePrice(PackageType.First, priceFirstPackage);
        setPackageTypePrice(PackageType.Second, priceSecondPackage);
        setPackageTypePrice(PackageType.Third, priceThirdPackage);
        setPackageTypePieces(PackageType.First, 3);
        setPackageTypePieces(PackageType.Second, 6);
        setPackageTypePieces(PackageType.Third, 10);
    }

    function setAdminAddress(address adminAddress) external onlyOwner {
        _adminAddress = adminAddress;
    }

    function setFirstPackageLimit(uint32 quantity) external onlyOwner {
        firstPackageLimit = quantity;
    }

    function setSecondPackageLimit(uint32 quantity) external onlyOwner {
        secondPackageLimit = quantity;
    }

    function setThirdPackageLimit(uint32 quantity) external onlyOwner {
        thirdPackageLimit = quantity;
    }

    function setPackageTypePieces(PackageType _packageType, uint8 quantity)
        public
        onlyOwner
    {
        _packageTypePieces[_packageType] = quantity;
    }

    function setPackageTypePrice(PackageType _packageType, uint256 amount)
        public
        onlyOwner
    {
        _packageTypePrice[_packageType] = amount;
    }

    function setpiecePackagePrice(uint256 _price) external onlyOwner {
        piecePackagePrice = _price;
    }

    function setTokenAddress(address _addr) external onlyOwner {
        _mekaAddress = _addr;
    }

    function setPieceAddress(address _addr) external onlyOwner {
        _pieceAddress = _addr;
    }

    function updateCanUnpack() external onlyOwner {
        canUnpack = !canUnpack;
    }

    function updatePackageAvailable() external onlyOwner {
        isPackageAvailable = !isPackageAvailable;
    }

    // @dev Sets the reference to the burn.
    function updateIsBurn() external onlyOwner {
        isBurn = !isBurn;
    }

    modifier canOpen() {
        require(canUnpack, "can not open");
        _;
    }

    modifier packageAvailable() {
        require(isPackageAvailable, "package unavailable");
        _;
    }

    function withdrawBalance() external onlyOwner {
        IBEP20(_mekaAddress).transfer(owner(), getBalance());
    }

    function withdrawBnb() external onlyOwner {
        uint256 amount = address(this).balance;

        (bool success, ) = payable(owner()).call{value: amount}("");
        require(success, "Failed to send Ether");
    }

    function getBalance() public view returns (uint256) {
        return IBEP20(_mekaAddress).balanceOf(address(this));
    }

    function getBnbBalance() public view returns (uint256) {
        return address(this).balance;
    }

    function pause() external whenNotPaused onlyOwner {
        _pause();
    }

    function unpause() external whenPaused onlyOwner {
        _unpause();
    }

    /* Piece PACKAGE */

    function getPackage(uint256 _id)
        public
        view
        returns (Package memory package)
    {
        package = packages[_id - 1];
    }

    function _mintPackage(
        address _to,
        uint256 _tokenId,
        PackageType _packageType
    ) private {
        Package memory _package = Package({
            packageType: _packageType,
            packageId: _tokenId,
            quantity: _packageTypePieces[_packageType],
            birthTime: uint64(block.timestamp)
        });

        _safeMint(_to, _tokenId, "");
        packages.push(_package);

        emit PackageCreated(
            _to,
            _package.packageId,
            uint8(_package.packageType),
            block.timestamp
        );

        emit Transfer(address(0), _to, _package.packageId);
    }

    function createPackage(
        address _owner,
        uint256 _amount,
        PackageType _packageType
    ) external payable nonReentrant packageAvailable {
        require(_packageType != PackageType.Default, "invalid package");
        require(_owner != address(0), "ERC721: mint to the zero address");
        require(_amount >= _packageTypePrice[_packageType], "INVALID AMOUNT");
        require(_amount == msg.value, "amount different from bnb required");

        if (_packageType == PackageType.First) {
            require(firstPackageCount < firstPackageLimit, "sold out");
            firstPackageCount++;
        } else if (_packageType == PackageType.Second) {
            require(secondPackageCount < secondPackageLimit, "sold out");
            secondPackageCount++;
        } else {
            require(thirdPackageCount < thirdPackageLimit, "sold out");
            thirdPackageCount++;
        }

        _mintPackage(_owner, nextPackageTokenId, _packageType);
        nextPackageTokenId++;
    }

    function openPackage(
        address _to,
        uint256 _amount,
        uint256 _tokenId,
        uint256 _nonce,
        bytes memory _signature
    ) external canOpen {
        require(verify(_to, _amount, _nonce, _signature), "not signed");
        require(!usedNonces[_nonce]);
        require(_amount >= piecePackagePrice, "INVALID AMOUNT");
        require(_to != address(0), "mint to the zero address");
        require(IBEP20(_mekaAddress).transferFrom(_to, address(this), _amount));

        Package memory package = packages[_tokenId - 1];

        IPieceCore(_pieceAddress).createPieceFromBundle(
            _to,
            uint8(package.packageType),
            package.quantity
        );

        _burn(_tokenId);

        emit Unpacked(
            _to,
            _tokenId,
            uint8(package.packageType),
            block.timestamp
        );
    }

    function getPackagesCount()
        external
        view
        returns (
            uint32 _firstPackageCount,
            uint32 _secondPackageCount,
            uint32 _thirdPackageCount
        )
    {
        _firstPackageCount = firstPackageCount;
        _secondPackageCount = secondPackageCount;
        _thirdPackageCount = thirdPackageCount;
    }

    function getMessageHash(
        address _to,
        uint256 _amount,
        uint256 _nonce
    ) public pure returns (bytes32) {
        return keccak256(abi.encodePacked(_to, _amount, _nonce));
    }

    function getEthSignedMessageHash(bytes32 _messageHash)
        public
        pure
        returns (bytes32)
    {
        return
            keccak256(
                abi.encodePacked(
                    "\x19Ethereum Signed Message:\n32",
                    _messageHash
                )
            );
    }

    function verify(
        address _to,
        uint256 _amount,
        uint256 _nonce,
        bytes memory _signature
    ) public view returns (bool) {
        bytes32 messageHash = getMessageHash(_to, _amount, _nonce);
        bytes32 ethSignedMessageHash = getEthSignedMessageHash(messageHash);

        return recoverSigner(ethSignedMessageHash, _signature) == _adminAddress;
    }

    function recoverSigner(
        bytes32 _ethSignedMessageHash,
        bytes memory _signature
    ) public pure returns (address) {
        (bytes32 r, bytes32 s, uint8 v) = splitSignature(_signature);

        return ecrecover(_ethSignedMessageHash, v, r, s);
    }

    function splitSignature(bytes memory sig)
        public
        pure
        returns (
            bytes32 r,
            bytes32 s,
            uint8 v
        )
    {
        require(sig.length == 65, "invalid signature length");

        assembly {
            r := mload(add(sig, 32))
            s := mload(add(sig, 64))
            v := byte(0, mload(add(sig, 96)))
        }
    }
}
